import React from "react";
import styled from "styled-components";

export const Main = styled.div`
  textalign: left;
  display: flex;
  width: 34rem;
  flexdirection: column;
  margintop: 30px;
`;

export const WorkspaceDiv = styled.div`
  background: #6a5ee5;
  padding: 19px;
  paddingtop: 12px;
  padding: 12px;
  width: 391px;
  borderradius: 5px;
  color: white;
  textalign: center;
  outline: none;
  textdecoration: none;
`;
